import React, { useState } from 'react';

 const state = useState();
 

let count = 1;

const IncNum = ()=>

{
    
    console.log("clicked"+ count++);
}

const Game =() =>
{
    return(
        <>
        <h1>{count}</h1>
        <button onClick={IncNum}>CLICK ME</button>
    
  </>
    
    
    );
};

export default Game;
